import React from 'react';
// import logo from './logo.svg';
import './App.css';
import { Button } from 'antd';
import {PlusOutlined} from "@ant-design/icons";
function App() {
  return (
   <Button 
    type="primary" icon={<PlusOutlined/>} 
    data-testid="add-contact-button">
    Add
   </Button>
  );
}

export default App;
